Solution Reveal: Assume the hexagons are mutually distinct and there are exactly 3 different types of centers (center A, B, C); Each has 2020 unique centers due to adjacency rules; Each pair of centers can relate to either adjacent hexagons (types of centers included) or congruent hexagons as far from each other as possible (thus maximizing pairs). Thus, the maximum number of adjacent pairs in-between centers is (2020 * 2020) + (a portion of 3a lucky centers) = 3*(2020^2). Pairs that would be countershaded from each other rely on the maximum amount of types that can relate, which would be the sum of the part of 3a + b + c able to fulfill gap functions.

Final Answer: \boxed{4*(2020^2)}

